        // State of PayPal module initialization\n        var clientInit = false;\n\n        return Component.extend({\n\n            defaults: {\n                template: 'Magento_Paypal/payment/paypal-express-in-context',\n                clientConfig: {\n                    /**\n                     * @param {Object} event\n                     */\n                    click: function (event) {\n                        event.preventDefault();\n\n                        if (additionalValidators.validate()) {\n                            paypalExpressCheckout.checkout.initXO();\n\n                            this.selectPaymentMethod();\n                            setPaymentMethodAction(this.messageContainer).done(function () {\n                                $('body').trigger('processStart');\n\n                                $.getJSON(this.path, {\n                                    button: 0\n                                }).done(function (response) {\n                                    var message = response && response.message;\n\n                                    if (message) {\n                                        if (message.type === 'error') {\n                                            messageList.addErrorMessage({\n                                                message: message.text\n                                            });\n                                        } else {\n                                            messageList.addSuccessMessage({\n                                                message: message.text\n                                            });\n                                        }\n                                    }\n\n                                    if (response && response.url) {\n                                        paypalExpressCheckout.checkout.startFlow(response.url);\n\n                                        return;\n                                    }\n\n                                    paypalExpressCheckout.checkout.closeFlow();\n                                }).fail(function () {\n                                    paypalExpressCheckout.checkout.closeFlow();\n                                }).always(function () {\n                                    $('body').trigger('processStop');\n                                    customerData.invalidate(['cart']);\n                                });\n                            }.bind(this)).fail(function () {\n                                paypalExpressCheckout.checkout.closeFlow();\n                            });\n                        }\n                    }\n                }\n            },\n\n            /**\n             * @returns {Object}\n             */\n            initialize: function () {\n                this._super();\n                this.initClient();\n\n                return this;\n            },\n\n            /**\n             * @returns {Object}\n             */\n            initClient: function () {\n                var selector = '#' + this.getButtonId();\n\n                _.each(this.clientConfig, function (fn, name) {\n                    if (typeof fn === 'function') {\n                        this.clientConfig[name] = fn.bind(this);\n                    }\n                }, this);\n\n                if (!clientInit) {\n                    domObserver.get(selector, function () {\n                        paypalExpressCheckout.checkout.setup(this.merchantId, this.clientConfig);\n                        clientInit = true;\n                        domObserver.off(selector);\n                    }.bind(this));\n                } else {\n                    domObserver.get(selector, function () {\n                        $(selector).on('click', this.clientConfig.click);\n                        domObserver.off(selector);\n                    }.bind(this));\n                }\n\n                return this;\n            },\n\n            /**\n             * @returns {String}\n             */\n            getButtonId: function () {\n                return this.inContextId;\n            }\n        });\n    }\n);\n","Magento_Paypal/js/view/review/actions/iframe.js":"/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n\n/**\n * @deprecated since version 2.2.0\n */\ndefine([\n    'uiComponent',\n    'ko',\n    'Magento_Paypal/js/model/iframe'\n], function (Component, ko, iframe) {\n    'use strict';\n\n    return Component.extend({\n        defaults: {\n            template: 'Magento_Paypal/review/actions/iframe'\n        },\n\n        /**\n         * @return {*}\n         */\n        getCode: function () {\n            return this.index;\n        },\n\n        /**\n         * @return {String}\n         */\n        getActionUrl: function () {\n            return this.isInAction() ? window.checkoutConfig.payment.paypalIframe.actionUrl[this.getCode()] : '';\n        },\n\n        /**\n         * @return {Boolean}\n         */\n        afterSave: function () {\n            iframe.setIsInAction(true);\n\n            return false;\n        },\n\n        /**\n         * @return {*}\n         */\n        isInAction: function () {\n            return iframe.getIsInAction()();\n        },\n\n        /**\n         * @param {Object} context\n         * @return {Function}\n         */\n        placeOrder: function (context) {\n            return context.placeOrder.bind(context, this.afterSave);\n        }\n    });\n});\n","Magento_Paypal/js/in-context/billing-agreement.js":"/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\ndefine([\n    'jquery',\n    'Magento_Ui/js/modal/confirm',\n    'Magento_Customer/js/customer-data'\n], function ($, confirm, customerData) {\n    'use strict';\n\n    $.widget('mage.billingAgreement', {\n        options: {\n            invalidateOnLoad: false,\n            cancelButtonSelector: '.block-billing-agreem